import { Server, Magic, Dashboard } from "grommet-icons";

const CardsArr = [
    {
        id: 1,
        icon: <Magic />,
        title: "Customs Annexure",
        body: "This is Module 1 and contain 7 sections",
        link: "/tabtile"
    },
    {
        id: 2,
        icon: <Server />,
        title: "Asset Tracker",
        body: "This is Module 2 and contain 4 sections",
        link: "/faltu"
    },
    {
        id: 3,
        icon: <Dashboard />,
        title: "Dashboard",
        body: "Getting Your Dashboard Here",
        link: "/faltu"
    }
  ];

  export default CardsArr;
